/*Table structure for table `gestiones_juridicas` */

DROP TABLE IF EXISTS `gestiones_juridicas`;

CREATE TABLE `gestiones_juridicas` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `proceso_id` int(11) NOT NULL COMMENT 'Proceso ID',
  `fecha_gestion` datetime NOT NULL COMMENT 'Fecha de gestión',
  `usuario_gestion` varchar(100) NOT NULL COMMENT 'Usuario de gestión',
  `descripcion_gestion` text NOT NULL COMMENT 'Descripción gestión',
  PRIMARY KEY (`id`),
  KEY `fk_gestiones_juridicas_procesos_idx` (`proceso_id`),
  CONSTRAINT `fk_gestiones_juridicas_procesos` FOREIGN KEY (`proceso_id`) REFERENCES `procesos` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf8;

