/*Table structure for table `historial_estados_x_proceso` */

DROP TABLE IF EXISTS `historial_estados_x_proceso`;

CREATE TABLE `historial_estados_x_proceso` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'Identificador del estado por proceso',
  `proceso_id` int(11) NOT NULL COMMENT 'Identificador del proceso',
  `etapa_procesal_id` int(11) NOT NULL COMMENT 'Identificador de la etapa procesal en la que se encuentra el proceso',
  `tipo_proceso_id` int(11) NOT NULL COMMENT 'Identificador del tipo de proceso',
  `created` datetime NOT NULL COMMENT 'Fecha en la que se crea el registro',
  `created_by` varchar(100) NOT NULL COMMENT 'Usuario que crea el registro',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;

