/*Table structure for table `jurisdicciones_competentes` */

DROP TABLE IF EXISTS `jurisdicciones_competentes`;

CREATE TABLE `jurisdicciones_competentes` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `ciudad_id` int(11) NOT NULL COMMENT 'Ciudad',
  `entidad` varchar(45) NOT NULL COMMENT 'Entidad',
  `codigo_entidad` char(3) NOT NULL COMMENT 'Código de entidad',
  `especialidad` varchar(45) NOT NULL COMMENT 'Especialidad',
  `codigo_especialidad` char(3) NOT NULL COMMENT 'Código de especialidad',
  `despacho` char(3) NOT NULL COMMENT 'Despacho',
  `nombre` varchar(100) NOT NULL COMMENT 'Nombre',
  `created` datetime NOT NULL COMMENT 'Creado',
  `created_by` varchar(45) NOT NULL COMMENT 'Creado por',
  `modified` datetime NOT NULL COMMENT 'Modificado',
  `modified_by` varchar(45) NOT NULL COMMENT 'Modificado por',
  `delete` tinyint(1) DEFAULT '0' COMMENT 'Borrado',
  `deleted` datetime DEFAULT NULL COMMENT 'Borrado',
  `deleted_by` varchar(45) DEFAULT NULL COMMENT 'Borrado por',
  PRIMARY KEY (`id`),
  KEY `fk_jurisdicciones_competentes_ciudades_idx` (`ciudad_id`),
  CONSTRAINT `fk_jurisdicciones_competentes_ciudades` FOREIGN KEY (`ciudad_id`) REFERENCES `ciudades` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=3479 DEFAULT CHARSET=utf8;

