  CONSTRAINT `fk_procesos_jurisdicciones_competentes` FOREIGN KEY (`jur_jurisdiccion_competent_id`) REFERENCES `jurisdicciones_competentes` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
